import React from "react"
import {Link, Switch, Route} from "react-router-dom"
import Banner from "../components/Banner"
import Map from "../components/Map"
import Quote from "../components/Quote"
import Section from "../components/Section"
import writingImg from "../components/images/writing.svg"
import graphicImg from "../components/images/trees.svg"
import Parallax from "../components/Parallax"
import Carousel from "../components/Carousel"
import data from "../data"

function Home(){

    console.log(data)
    return (
        <>
            <Parallax rate="1">
                {(para)=> (
                <Banner data={para}/>
                )}        
            </Parallax>

            <main>
                <Parallax rate="2">
                    {para => (
                    <Map data={para}/>
                    )}
                </Parallax>
                {data.map(item => {
                <Carousel key={item.id} object={item}/>
            })}
                {/* <Section text="Creative writing" img={writingImg} />
                <Section text="Graphic Design" img={graphicImg} /> */}
                <Quote />
            </main>
        </>
    )
}

export default Home
